import React from 'react';
import './Barnav.css';
import SoftSkills from './SoftSkills';


const Barnav = () => {
	return (
		<div id="barraNavegacion">
		<section id="home">
			<nav className='bt bb tc mw7 center mt4'>
				<ul>
					<li><a className='one two hover-bg-light-blue' href="#SoftSkills" title="Human Skills">Soft Skills</a></li>
					<li><a className='one two hover-bg-light-pink' href="#EducationCourses" title="Education and Courses">Education and Courses</a></li>
					<li><a className='one two hover-bg-light-green' href="#HardSkills" title="Personal Skills">Hard Skills</a></li>
				</ul>
			</nav>
			</section>
		</div>
	);
}

export default Barnav;
